var api_host_dev = "http://web-api.int.testunited.minikube.local";


function getApiHost(){
    console.log(window.location.protocol);
    if(window.location.hostname === "localhost")
        return api_host_dev;
    else
        return window.location.hostname.replace("web-ui","web-api");
}

export default getApiHost;
